import React from "react";
import { FaUserGraduate, FaChartLine } from "react-icons/fa";

function Bachelors() {
  return (
    <div className="p-12 relative">
      <h2 className="text-3xl font-bold mb-6 text-blue-400 flex items-center gap-2">
        <FaUserGraduate /> Bachelor's Journey
      </h2>
      <img src="/bachelors.jpg" alt="Bachelor's Highlights" className="mx-auto mb-6 rounded-lg shadow-md w-full max-w-xl" />
      <p className="text-lg leading-relaxed mb-6">
        <span className="block text-xl font-bold text-blue-300 mb-1">Academic Excellence</span>
        I graduated summa cum laude with a 3.81 GPA and was on the Deanâ€™s List for 4 semesters. I was a proud member of Psi Chi, the International Psychology Honor Society.
      </p>
      <p className="text-lg leading-relaxed mb-6">
        <span className="block text-xl font-bold text-blue-300 mb-1">Debate Leadership</span>
        I was Vice President and Social Media Head for our Debate Club. I represented our university in national tournaments, including the FIFA academic tournament, while also promoting events and supporting peers.
      </p>
      <p className="text-lg leading-relaxed">
        <span className="block text-xl font-bold text-blue-300 mb-1">Cultural Impact</span>
        I co-founded the South Asian Club to bring culture to campus. Through dance, festivals, and community events, we connected international students to their roots.
      </p>
      <FaChartLine className="absolute bottom-8 right-8 text-blue-900 opacity-10 text-8xl" />
    </div>
  );
}

export default Bachelors;
